import React from "react";
import SignIn from "../../components/auth/sign-in/SignIn";

import "./sign-in-and-sign-up.scss";

const SignInAndSignUp = () => {
  return (
    <div className='sign-in-and-sign-up'>
      <SignIn />
    </div>
  );
};

export default SignInAndSignUp;
